    function jumpSystem(){
        playerZ -= velocityY;
        velocityY *= accGrav;
        if(map[Math.floor(y/square)][Math.floor(x/square)] > 0 && map[Math.floor(y/square)][Math.floor(x/square)] <= 6){
            if(playerZ < 55){
                playerZ = 55
                l2Grounded = true;
            }else{
                l2Grounded = false;
            }
        }else{
            l2Grounded = false;
        }
        if(playerZ <= 6 || l2Grounded == true){
            grounded = true;
            velocityY = 0;
        }else{
            if(grounded != false && jumping == false){
                grounded = false;
                velocityY = 0.1;
                accGrav = 1.1481;
            }
        }

        if(velocityY > 0.1*(-1) && velocityY < 0){
            jumping = false;
        }

        if(l2Grounded == true){
            jumping = false;
        }


        if(upB == true && jumping == false && grounded == true){
            velocityY = -7.5
            jumping = true;
            accGrav = 0.85;
        }

        if(playerZ < 6){
            playerZ = 6;
        }
    }
    
